define('text!views/login.html',[],function () { return '<header class="page-header">\r\n    <h1 data-bind="text: title"></h1>\r\n</header>\r\n<section id="content" class="container col-md-12">\r\n    <iframe class="col-md-12" id="loginTarget" src="/account/loginform" seamless="seamless" style="overflow:hidden;height:300px;display:none;" frameborder="0"> </iframe>\r\n    <div class="panel panel-default" data-bind="event: { keypress: keyMonitor }">\r\n        <div class=" btn-toolbar panel-heading">\r\n        <div class="btn-group btn-group-sm">\r\n            <button id="loginbutton" class="btn btn-primary btn-sm" data-bind="click: doLogin">Login</button>\r\n        </div>\r\n    </div>\r\n        <div class="panel-body">\r\n            <div class="form-horizontal">\r\n                <div class="form-group">\r\n                    <label class="col-md-2 col-sm-2 control-label" for="username">Username: </label>\r\n                    <div class="col-md-3 col-sm-3">\r\n                        <input class="form-control input-sm" id="username" name="username" type="text" data-bind="value: username" />\r\n                    </div>\r\n                </div>\r\n                <div class="form-group">\r\n                    <label class="col-md-2 col-sm-2  control-label" for="password">Password: </label>\r\n                    <div class="col-md-3 col-sm-3">\r\n                        <input class="form-control input-sm" id="password" name="password" type="password" data-bind="value: password" />\r\n                    </div>\r\n                </div>\r\n\r\n\r\n            </div>\r\n        </div>\r\n    </div>\r\n</section>\r\n';});

