define('text!views/nav.html',[],function () { return '<div class="navbar navbar-default navbar-fixed-top" role="navigation">\n    <div class="container">\n        <!-- Brand and toggle get grouped for better mobile display -->\n        <div class="navbar-header">\n            <button id="navMainButton" type="button" class="navbar-toggle" data-toggle="collapse" data-target=".navbar-ex1-collapse">\n                <span class="sr-only" data-i18n="appuitext:navMainToggleNavigation"></span>\n                <span class="icon-bar"></span>\n                <span class="icon-bar"></span>\n                <span class="icon-bar"></span>\n            </button>\n            <a href="/#" data-i18n="[class]appuitext:cssNavLogo"></a>\n        </div>\n        <!-- Collect the nav links, forms, and other content for toggling -->\n        <div id="navMain" class="navbar-collapse collapse navbar-ex1-collapse">\n            <ul class="nav navbar-nav" data-bind="foreach: router.navigationModel">\n                <li data-bind="css: { active: isActive }">\n                    <a data-bind="attr: { href: hash }, text: title, html: button"></a>\n                </li>\n            </ul>\n            <ul class="nav navbar-nav navbar-right">\n                <li class="dropdown" data-bind="visible: hasAdminRoutes()">\n                    <a href="#" class="dropdown-toggle" data-toggle="dropdown"><i class="icon-cog"></i> <span data-i18n="appuitext:navMainAdmin"></span><b class="caret"></b></a>\n                    <ul class="dropdown-menu" data-bind="foreach: router.adminNavigationModel">\n                        <li data-bind="css: { active: $parent.router.isActive }">\n                            <a data-bind="attr: { href: hash }, text: title"></a>\n                        </li>\n\n                    </ul>\n                </li>\n                <!-- ko foreach: router.accountNavigationModel -->\n                <li data-bind="css: { active: $data.isActive }">\n                    <a data-bind="attr: { href: $data.hash }, text: $data.title, html: $data.button"></a>\n                </li>\n                <!-- /ko -->\n                <li>\n                    <a id="loader" data-bind="css: { active: router.isNavigating }">\n                        <i class="nav-loader icon-spinner icon-2x icon-spin" style="margin-right: 15px;"></i>\n                    </a>\n                </li>\n\n            </ul>\n        </div>\n\n\n\n        <!-- /.navbar-collapse -->\n\n\n        <!--   <div class="nav navbar-text progress" style="width: 300px; margin-top:10px">\n                <div class="bar" style="width: 30%;"></div>\n            </div> -->\n        <!--<div class="loader pull-right" data-bind="css: { active: router.isNavigating }">\n            <div class="progress progress-striped active page-progress-bar">\n                <div class="bar" style="width: 100px;"></div>\n            </div>\n        </div>-->\n    </div>\n</div>\n\n<!---->\n';});

define('text!views/shell.html',[],function () { return '\r\n\r\n<div id="wrap">\r\n    <header data-bind="compose: \'viewmodels/nav\'"></header>\r\n    \r\n    <section id="content" class="bodyContent container" data-bind="router: { transition: \'entrance\', cacheViews: false }"></section>\r\n\r\n</div>\r\n<footer id="footer">\r\n    <div class="container" data-bind="compose: { view: \'footer\' }"></div>\r\n</footer>\r\n\r\n';});

define('text!views/ticketcreate.html',[],function () { return '<section id="session-view">\r\n\r\n    <header class="page-header">\r\n        <h1 data-bind="text: title"></h1>\r\n    </header>\r\n    <div class="panel panel-default">\r\n        <div class="btn-toolbar panel-heading">\r\n            <div class="btn-group btn-group-sm">\r\n                <button class="btn btn-primary btn-sm"\r\n                    data-bind="click: goBack">\r\n                    <i class="icon-hand-left"></i>&nbsp;Back</button>\r\n                <button class="btn btn-primary btn-sm"\r\n                    data-bind="click: cancel, enable: canSave">\r\n                    <i class="icon-undo"></i>&nbsp;Cancel</button>\r\n            </div>\r\n            <div class="btn-group">\r\n                <button class="btn btn-success btn-sm"\r\n                    data-bind="click: save, enable: canSave">\r\n                    <i class="icon-save"></i>&nbsp;Save</button>\r\n\r\n            </div>\r\n            <i class="icon-asterisk" data-bind="visible: hasChanges" style="color: orange;"></i>\r\n        </div>\r\n\r\n        <section class="panel-body" data-bind="with: ticket">\r\n            <div class="form-horizontal">\r\n\r\n                <div class="form-group">\r\n                    <label class="col-md-1 col-sm-1 control-label" for="title">Title</label>\r\n                    <div class="col-md-8 col-sm-11">\r\n                        <input type="text" class="form-control input-sm" id="title" data-bind="value: title"\r\n                            placeholder="Ticket title" />\r\n                    </div>\r\n                </div>\r\n\r\n                <div class="form-group">\r\n                    <label class="col-md-1 col-sm-1 control-label" for="ticketType">Type</label>\r\n                    <div class="col-md-3 col-sm-3">\r\n                        <select id="ticketType" class="form-control input-sm" data-bind="options: $parent.ticketTypeList, optionsText: \'value\',\r\n    optionsValue: \'value\', value: ticketType, optionsCaption: \' \'">\r\n                        </select>\r\n                    </div>\r\n\r\n\r\n                    <label class="col-md-1 col-sm-2 control-label" for="category">Category</label>\r\n                    <div class="col-md-3 col-sm-3">\r\n                        <select id="category" class="form-control input-sm" data-bind="options: $parent.categoryList, optionsText: \'value\',\r\n    optionsValue: \'value\', value: category, optionsCaption: \' \'">\r\n                        </select>\r\n                    </div>\r\n\r\n                    <label class="col-md-1 col-sm-1 control-label" for="priority">Priority</label>\r\n                    <div class="col-md-3 col-sm-2">\r\n                        <select id="priority" class="form-control input-sm" data-bind="options: $parent.priorityList, optionsText: \'value\',\r\n    optionsValue: \'value\', value: priority, optionsCaption: \' \'">\r\n                        </select>\r\n                    </div>\r\n                </div>\r\n\r\n                <div class="form-group">\r\n                    <label class="col-md-1 col-sm-1 control-label" for="tagList">Tags</label>\r\n                    <div class="col-md-7 col-sm-7">\r\n                        <input type="text" class="form-control input-sm" id="tagList" data-bind="value: tagListFormatted" placeholder="tag1,tag2" />\r\n                    </div>\r\n                    <div class="col-md-4 col-sm-4">\r\n                        <label class="checkbox-inline" for="affectsCustomer">\r\n                            <input class="" type="checkbox" id="affectsCustomer" data-bind="checked: affectsCustomer" />\r\n                            Affects Customer\r\n                        </label>\r\n                    </div>\r\n                </div>\r\n                <div class="form-group">\r\n                    <label class="col-md-1 col-sm-1 control-label" for="wmd-input-ticketDetails">Details</label>\r\n                    <div class="col-md-11 col-sm-11 wmd-panel">\r\n                        <div class="tabbable">\r\n\r\n                            <div class="tab-content">\r\n                                <ul class="nav nav-tabs pull-right">\r\n                                    <li class="active"><a href="#tab1" data-toggle="tab"><i class="icon-edit"></i></a></li>\r\n                                    <li><a href="#tab2" data-toggle="tab"><i class="icon-search"></i></a></li>\r\n                                </ul>\r\n                                <div class="tab-pane" id="tab2">\r\n                                    <div class="row" style="min-height: 35px;"></div>\r\n                                    <div id="wmd-preview-ticketDetails" class="wmd-panel wmd-preview form-control"></div>\r\n                                </div>\r\n                                <div class="tab-pane active" id="tab1">\r\n                                    <div id="wmd-button-bar-ticketDetails" style="display: inline-block"></div>\r\n                                    <div>\r\n\r\n                                        <textarea class="wmd-input form-control" id="wmd-input-ticketDetails" name="ticketDetails" rows="10" data-bind="value: details" style="height: 250px;"></textarea>\r\n                                    </div>\r\n\r\n                                </div>\r\n                            </div>\r\n\r\n                        </div>\r\n                    </div>\r\n\r\n                </div>\r\n                <div class="form-group">\r\n                    <label class="col-md-1 col-sm-2 control-label" for="owner">Owner</label>\r\n                    <div class="col-md-4 col-sm-4">\r\n                        <input class="form-control input-sm" type="text" id="owner" data-bind="value: owner" placeholder="person name" />\r\n                    </div>\r\n                    <label class="col-md-2 col-sm-2 control-label" for="assignedTo">Assigned To</label>\r\n                    <div class="col-md-4 col-sm-4">\r\n                        <input class="form-control input-sm" type="text" id="assignedTo" data-bind="value: assignedTo"\r\n                            placeholder="person name" />\r\n\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </section>\r\n    </div>\r\n</section>';});

define('text!views/ticketdetails.html',[],function () { return '<section id="session-view" class="view">\r\n    <h2 class="page-title" data-bind="text: title"></h2>\r\n    <div class="button-bar btn-block">\r\n        <button class="btn btn-info"\r\n            data-bind="click: goBack">\r\n            <i class="icon-hand-left"></i> Back</button>\r\n        <button class="btn btn-info"\r\n            data-bind="click: cancel, enable: canSave">\r\n            <i class="icon-undo"></i> Cancel</button>\r\n        <button class="btn btn-info"\r\n            data-bind="click: save, enable: canSave">\r\n            <i class="icon-save"></i> Save</button>\r\n        <!--        <button class="btn btn-danger"\r\n            data-bind="click: deleteSession, disable: hasChanges">\r\n            <i class="icon-trash"></i>Delete\r\n        </button>-->\r\n        <i class="icon-asterisk" data-bind="visible: hasChanges"></i>\r\n    </div>\r\n    <div class="form-horizontal" data-bind="with: ticket">\r\n        <div>\r\n            <div class="control-group">\r\n                <label class="control-label" for="title">Title</label>\r\n                <div class="controls">\r\n                    <input type="text" id="title" data-bind="value: title"\r\n                        placeholder="Ticket title" />\r\n                </div>\r\n            </div>\r\n\r\n            <div class="control-group">\r\n                <label class="control-label" for="category">Status</label>\r\n                <div class="controls">\r\n                    <select id="ticketStatus" data-bind="options: $parent.statusList, optionsText: \'name\',\r\n                        optionsValue: \'value\', value: ticketStatus, optionsCaption: \'--select--\'">\r\n                    </select>\r\n                </div>\r\n\r\n            </div>\r\n\r\n            <div class="control-group">\r\n                <label class="control-label" for="category">Category</label>\r\n                <div class="controls">\r\n                    <select id="category" data-bind="options: $parent.categoryList, optionsText: \'value\',\r\n                        optionsValue: \'value\', value: category, optionsCaption: \'--select--\'">\r\n                    </select>\r\n                </div>\r\n\r\n            </div>\r\n            <div class="control-group">\r\n                <label class="control-label" for="ticketType">Type</label>\r\n                <div class="controls">\r\n                    <select id="ticketType" data-bind="options: $parent.ticketTypeList, optionsText: \'value\',\r\n                        optionsValue: \'value\', value: ticketType, optionsCaption: \'--select--\'">\r\n                    </select>\r\n                </div>\r\n\r\n            </div>\r\n            <div class="control-group">\r\n                <label class="control-label" for="priority">Priority</label>\r\n                <div class="controls">\r\n                    <select id="priority" data-bind="options: $parent.priorityList, optionsText: \'value\',\r\n                        optionsValue: \'value\', value: priority, optionsCaption: \'--select--\'">\r\n                    </select>\r\n                </div>\r\n            </div>\r\n            <div class="control-group">\r\n                <label class="control-label" for="tagList">Tags</label>\r\n                <div class="controls">\r\n                    <input type="text" id="tagList" data-bind="value: tagListFormatted" placeholder="tag1,tag2" />\r\n                </div>\r\n            </div>\r\n            <div class="control-group">\r\n                <label class="control-label" for="owner">Owner</label>\r\n                <div class="controls">\r\n                    <input type="text" id="owner" data-bind="value: owner" />\r\n                </div>\r\n            </div>\r\n            <div class="control-group">\r\n                <label class="control-label" for="assignedTo">Assigned To</label>\r\n                <div class="controls">\r\n                    <input type="text" id="assignedTo" data-bind="value: assignedTo"\r\n                        placeholder="person name" />\r\n                </div>\r\n            </div>\r\n            <div class="control-group">\r\n                <div class="controls">\r\n                    <label class="checkbox" for="affectsCustomer">\r\n                        <input type="checkbox" id="affectsCustomer" data-bind="checked: affectsCustomer" />Affects Customer</label>\r\n                </div>\r\n            </div>\r\n\r\n        </div>\r\n\r\n        <div class="control-group">\r\n            <label class="control-label" for="description">Description</label>\r\n            <div class="controls">\r\n                <textarea id="description" style="width: 100%; min-height: 300px;"\r\n                    data-bind="value: details"\r\n                    placeholder="Enter description"></textarea>\r\n            </div>\r\n        </div>\r\n    </div>\r\n\r\n</section>\r\n';});

define('text!views/ticketlist.html',[],function () { return '<section id="tickets-view">\r\n    <header class="page-header">\r\n        <a class="btn btn-sm btn-primary pull-right"\r\n            data-bind="click: refresh" href="#"><i class="icon-refresh"></i>&nbsp;<span data-i18n="appuitext:btnRefresh" /></a>\r\n        <h1 data-bind="text: title"></h1>\r\n\r\n    </header>\r\n    <div>\r\n        <nav class="well well-sm">\r\n            <ul class="pager pagination pagination-sm col-md-12" style="display: block; margin: 0;">\r\n                <li class="previous" data-bind="css: { disabled: !canPrev() }">\r\n                    <a href="#" data-bind="click: previous, clickBubble: false"><i class="icon-chevron-left"></i>&nbsp;<span data-i18n="appuitext:pagerPrevious" /></a>\r\n                </li>\r\n                <li><small><i data-i18n="appuitext:pagerPage" />\r\n                    <!--ko text: currentPage -->\r\n                    <!--/ko-->\r\n                    <i data-i18n="appuitext:pagerOf" />\r\n                    <!--ko text: maxPage -->\r\n                    <!--/ko-->\r\n                    (<!-- ko text: rowCount --><!--/ko-->\r\n                    <i data-i18n="appuitext:pagerTotalTickets" />)</small></li>\r\n                <li class="next" data-bind="css: { disabled: !canNext() }">\r\n                    <a href="#" data-bind="click: next, clickBubble: false"><span data-i18n="appuitext:pagerNext" />&nbsp;<i class="icon-chevron-right"></i></a>\r\n                </li>\r\n            </ul>\r\n        </nav>\r\n        <section class="view-list" data-bind="template: { foreach: tickets, beforeRemove: hideTicketElement, afterAdd: showTicketElement, afterRender: ticketItemsRendered }">\r\n            <!--ko if: $index() != 0--><hr /><!--/ko-->\r\n            <article class="ticket-brief" title="Go to ticket details" data-bind="ticketChanged: lastUpdateDate">\r\n                <header class="row">\r\n                    <div class="col-md-7">\r\n                        <h4><span data-i18n="appmodeltext:ticketTicketId" />\r\n                            <!--ko text: ticketId -->\r\n                            <!--/ko-->\r\n                            <!--ko text:  $.i18n.t(\'appmodeltext:category\' + category()) -->\r\n                            <!--/ko-->\r\n                            <!--ko text:  $.i18n.t(\'appmodeltext:ticketType\' + ticketType())  -->\r\n                            <!--/ko-->\r\n                        </h4>\r\n                        <h5>\r\n                            <!--ko text: title -->\r\n                            <!--/ko-->\r\n                        </h5>\r\n                        <address>\r\n                            <div>\r\n                                <span data-i18n="appmodeltext:ticketOwner" />\r\n\r\n                                <!--ko text: owner || \'none\' -->\r\n                                <!--/ko-->\r\n                            </div>\r\n                            <div>\r\n                                <span data-i18n="appmodeltext:ticketAssignedTo" />\r\n                                <!--ko text: assignedTo() || \'unassigned\' -->\r\n                                <!--/ko-->\r\n                            </div>\r\n                        </address>\r\n\r\n                    </div>\r\n                    <div class="col-md-5">\r\n                        <div>\r\n                            <small>\r\n                                <!--ko text: $.i18n.t(\'appmodeltext:ticketStatus\' + ticketStatus()) -->\r\n                                <!--/ko-->\r\n                                -\r\n                                <!--ko text: $.i18n.t(\'appmodeltext:priority\' + priority()) -->\r\n                                <!--/ko-->\r\n                                <span data-i18n="appmodeltext:ticketPriority" />\r\n                            </small>\r\n                        </div>\r\n                        <div>\r\n                            <small>\r\n                                <!--ko text: createdCombined -->\r\n                                <!--/ko-->\r\n                            </small>\r\n                        </div>\r\n                        <div>\r\n                            <small>\r\n                                <!--ko text: lastUpdatedCombined -->\r\n                                <!--/ko-->\r\n                            </small>\r\n                        </div>\r\n                    </div>\r\n                </header>\r\n            </article>\r\n\r\n        </section>\r\n    </div>\r\n\r\n\r\n\r\n</section>\r\n';});

